import React from 'react'
import Card from './Card';
import './App.css'

const App = () => {
    return(
        <>
            <div className='cards'>
                <h1 className='heading_style'>List Of Top 5 Netflix Series In 2022</h1>
                <Card />
            </div>
        </>
    );
}

export default App;
